import React from 'react';
import SideBarMenu from './SideBarMenu';

const SideBarMenuBtn = () => {
    return (
        <div>
            <button className="border bg-purple-500 text-white">Show Menu</button>
            <SideBarMenu></SideBarMenu>
        </div>
    );
};

export default SideBarMenuBtn;
